tape_pointer = 0
memory_pointer = 0
memory = [0]
output = ''
while tape_pointer < len(tape):
    if tape[tape_pointer] == '>':
        memory_pointer += 1
        if memory_pointer == len(memory):
            memory.append(0)
    elif tape[tape_pointer] == '<':
        memory_pointer -= 1
    elif tape[tape_pointer] == '+':
        memory[memory_pointer] += 1
        if memory[memory_pointer] == 256:
            memory[memory_pointer] = 0
    elif tape[tape_pointer] == '*':
        output += chr(memory[memory_pointer])
    elif tape[tape_pointer] == '.':
        return output
    tape_pointer += 1
return output
